/* ************************** */
/*    ファイルのインポート     */
/* ************************** */
// 無操作の頂点シェーダー
import VERT_FILE from "./assets/main.vert"
// 無操作の頂点シェーダー
import FRAG_FILE from "./assets/main.frag"
import FRAG_FILE_00 from "./assets/main_00.frag"

// ファイルリスト
export let fileList = [
  {
    "vert": VERT_FILE,
    "frag": FRAG_FILE_00,
    "remarks": "白黒のフィルタ"
  },
  {
    "vert": VERT_FILE,
    "frag": FRAG_FILE_01,
    "remarks": "なにかコメントがあれば(どういったフィルタかの説明など)"
  },
]
